import React from 'react'

const TableDay = ({day, taskArray}) => {
  console.log(taskArray)
  
  return (
    <li className='table-day'>
        <ul className='tasks-list'>
          {
            // taskArray !== null || taskArray !== undefined
            // ? 
            taskArray.map(el =>
                <li key={el.taskId} className='tasks-item'>{el.taskId}. {el.text}</li>
              )
            
            // : <li className='tasks-item'></li>
          }
          
        </ul>
        <span className='list-day'>{day}</span>
    </li>
  )
}

export default TableDay
